issue.body:
when only use react is ok, but when use redux connect()(MyComponent) with the warning and no result. 

`class MyComponent extend react.Component{
  render(){
    return <h1>{intl.get('string')}</h1>
  }
}`

comment.body:
Yes, you should call `intl.init` before `render`.

For example, if you have some constants like this:
```jsx
// Wrong: the message in constants.fruits is used before `intl.init(...)`
const constants = {
    fruits : [
        { label: intl.get('banana'), value: 'banana' },
        { label: intl.get('apple'), value: 'apple' },
    ]
}
function MyComponent() {
    return <Select dataSource={constants.fruits} />
}
```

Rewrite it to:
```jsx
// Correct: make the message as a function, and call it at render function
const constants = {
    fruits : () => [  // as arrow function
        { label: intl.get('banana'), value: 'banana' },
        { label: intl.get('apple'), value: 'apple' },
    ]
}
function MyComponent() {
    // fruits is a function which returns message when rendering
    return <Select dataSource={constants.fruits()} />
}
```

It's by design because `react-intl-universal` could be used in non-react component. 

If you declare constants before `intl.init(...)`, the `intl.get` method is executed when js script loaded. So it can't get the locale data.
```jsx
const myData = {
  label: intl.get('key1').d('message'), 
  value: 1
}

const MyComp = () => {
   return <div>{myData.label}</div>   
}
```

Changing constants to function will work:
```jsx
const myData = {
  get label() {return intl.get('key1').d('message')}
  value: 1
}

const MyComp = () => {
   return <div>{myData.label}</div>   
}
```

